  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Structures are derived from two scales
  of a focal mean analysis on bathymetry; slope; and depth. The grid is based on gridded
  (5 m cell size) multibeam bathymetry, collected aboard NOAA Ship Hiialaka'i and
  R/V AHI, and it was creating using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
  Cell values represent one of 13 classes in an index of seafloor terrains. This data
  set is for the shelf and slope environments of Tutuila Island, American Samoa, South
  Pacific.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
